import React from 'react';
import styled from 'styled-components';
import Heart from '../assets/images/heart.png';

export default function Result() {



    return (

        <Instagramback>
            <Header>
                <div>
                    <span className="circle"></span>    
                </div>
            </Header>
            <Body>
                <div className="heart">
                    <img src={Heart}/>
                </div>

            </Body>
            <Bottom>

            </Bottom>
        </Instagramback>

    )

};
const Instagramback = styled.div`
background-image: linear-gradient(50deg, rgba(254,218,135,.7), rgba(237,163,203,.7));
    height: 100vh;
`;

const Header = styled.div`
    border-top: solid 1px;
    background : white;
    max-width: 500px;
    margin: 0 auto;
    height : 72px;
    top : 20%;
    left : 50%;
    transform : translate(0%,230%); // 자기 자신의 크기의 %만큼 왼쪽과 위쪽으로 이동.

    .circle {
        width : 42px;
        height : 42px;
        border : 1px solid #111; // solid는 선의 모양을 표현
        border-radius : 100%; // 윤곽선 표현 100%애 가까울 수록 둥글어진다. px로도 사용가능
        display : block;
        position : absolute;
        top : 15px;
        left : 20px;
    }
`;

const Body = styled.div`
    border-top: solid 1px;
    background : white;
    max-width: 500px;
    margin: 0 auto;
    height : 300px;
    top : 20%;
    left : 50%;
    transform : translate(-0%,55%); // 자기 자신의 크기의 %만큼 왼쪽과 위쪽으로 이동.
`;


const Bottom = styled.div`
    background : white;
    max-width: 500px;
    margin: 0 auto;
    height : 72px;
    top : 20%;
    left : 50%;
    transform : translate(0%,229%); // 자기 자신의 크기의 %만큼 왼쪽과 위쪽으로 이동.

    .heart {
        max-width : 24px;
        height : 24px;
        position : absolute;

    }
`;
